import { CodeIcon } from "@heroicons/react/solid";
import { projects } from "../data";
import { FaReact, FaGithub, FaUnity, FaVideo, FaNodeJs } from "react-icons/fa";
import { FaMeta } from "react-icons/fa6";
import { SiDjango, SiMysql, SiBlender, SiUnrealengine } from "react-icons/si";
import { RiTailwindCssFill } from "react-icons/ri";
import { GrHeroku } from "react-icons/gr";
import { IoLogoVercel } from "react-icons/io5";
import { AiOutlineOpenAI } from "react-icons/ai";
// Map icon names to actual icon components
import React, { useState } from "react";
const iconComponents = {
  FaReact,
  SiDjango,
  SiMysql,
  SiBlender,
  SiUnrealengine,
  FaUnity,
  FaMeta,
  FaNodeJs,
  RiTailwindCssFill,
  GrHeroku,
  AiOutlineOpenAI,
  IoLogoVercel,
};

const renderIcon = (iconName) => {
  const IconComponent = iconComponents[iconName];
  return IconComponent ? <IconComponent className="text-3xl mx-2" /> : null;
};

export default function Projects() {
  const [activeTab, setActiveTab] = useState("completed");

  const completedProjects = projects.filter(
    (projects) => project.status === "completed"
  );
  const inDevelopmentProjects = projects.filter(
    (projects) => project.status === "in-development"
  );
  const schoolCodeExamples = projects.filter(
    (projects) => project.status === "school"
  );

  return (
    <section id="projects" className="text-gray-800 bg-purple-100 body-font">
      <div className="container px-5 py-10 mx-auto text-center lg:px-40">
        {/* Tabs for navigation */}
        <div className="flex justify-center mb-8">
          <button
            className={`px-4 py-2 font-bold ${
              activeTab === "completed" ? "bg-gray-800 text-purple-100" : "bg-purple-100 text-gray-800"
            } rounded-lg mr-2`}
            onClick={() => setActiveTab("completed")}
          >
            Completed Projects
          </button>
          <button
            className={`px-4 py-2 font-bold ${
              activeTab === "in-development" ? "bg-gray-800 text-purple-100" : "bg-purple-100 text-gray-800"
            } rounded-lg mr-2`}
            onClick={() => setActiveTab("in-development")}
          >
            Projects in Development
          </button>
          <button
            className={`px-4 py-2 font-bold ${
              activeTab === "school" ? "bg-gray-800 text-purple-100" : "bg-purple-100 text-gray-800"
            } rounded-lg`}
            onClick={() => setActiveTab("school")}
          >
            School Code Examples
          </button>
        </div>

        {/* Content based on active tab */}
        {activeTab === "completed" && (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {completedProjects.map((project, index) => (
              <div key={index} className="p-4 bg-gray-800 rounded-lg border border-gray-700">
                <h2 className="text-lg font-bold text-purple-100 mb-2">{project.title}</h2>
                <p className="text-purple-200 text-sm mb-2">{project.description}</p>
                <div className="flex justify-center mt-2">
                  {project.technologies?.map((tech, techIndex) => (
                    <div key={techIndex}>{renderIcon(tech.icon)}</div>
                  ))}
                </div>
                {project.link && (
                  <a
                    href={project.link}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="text-purple-400 hover:text-white mt-2 inline-block"
                  >
                    View Project
                  </a>
                )}
              </div>
            ))}
          </div>
        )}

        {activeTab === "in-development" && (
          <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
            {inDevelopmentProjects.map((project, index) => (
              <div key={index} className="p-4 bg-gray-800 rounded-lg border border-gray-700">
                <h2 className="text-lg font-bold text-purple-100 mb-2">{project.title}</h2>
                <p className="text-purple-200 text-sm mb-2">{project.description}</p>
                <span className="inline-block bg-yellow-500 text-gray-800 text-xs px-2 py-1 rounded-full">
                  {project.progressStatus}
                </span>
              </div>
            ))}
          </div>
        )}

        {activeTab === "school" && (
          <div className="grid grid-cols-1 gap-6">
            {schoolCodeExamples.map((example, index) => (
              <div key={index} className="p-4 bg-gray-800 rounded-lg border border-gray-700">
                <h2 className="text-lg font-bold text-purple-100 mb-2">{example.title}</h2>
                <p className="text-purple-200 text-sm mb-4">{example.description}</p>
                <pre className="bg-gray-900 text-purple-100 p-4 rounded overflow-x-auto">
                  <code>{example.codeSnippet}</code>
                </pre>
              </div>
            ))}
          </div>
        )}
      </div>
    </section>
  );
}
